import { AnyAction } from "redux";
import { IDeteil } from "types/IDeteil";

const initialState = {
  movie: [],
};

export interface IStoreD {
  movie: IDeteil;
}

const movieReduserDeteilPage = (
  stateD: IStoreD[] = initialState,
  action: AnyAction
) => {
  switch (action.type) {
    case "cinema/setCinema":
      return { ...stateD };
    default:
      return stateD;
  }
};
export default movieReduserDeteilPage;
